<div class="cont2" style="display: none;">
<div class="dropdown-fil">- Lottie is 7.5 inches (18cm tall). Lotties height is based on the proportions of the average nine-year-old girl and was developed alongside academics in the areas of child psychology and nutrition.
This smaller height has the added value of reduced environmental impact (smaller packaging/less shipping and storage space).</div>
